import React from "react";
import ReactDom from "react-dom";
// import "./index.css";

//DESTRUCTURING

function People() {
  return (
    <section>
      <Person name="john" job="developer" />
      <Person name="bob" job="designer" age="22" />
      <Person name="susy" job="artist" />
    </section>
  );
}

const Person = props => {
  console.log(props);

  return (
    <div>
      <h1>{props.name}</h1>
      <p>{props.job}</p>
      <hr />
    </div>
  );
};

ReactDom.render(<People />, document.getElementById("root"));
